u043c\u0435\u043d\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0437\u0430\u043a\u043e\u043d, \u0437\u0430\u043f\u0440\u0435\u0449\u0430\u044e\u0449\u0438\u0439 \u0421\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c \u043a\u043e\u043b\u043e\u043d\u0438\u044f\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u0430\u0442\u044c \u0441 \u043a\u0435\u043c-\u043b\u0438\u0431\u043e \u043a\u0440\u043e\u043c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1791\" class=\"mw-redirect\" title=\"1791\">1791<\/a>&#160;\u2014 \u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0432\u0432\u0435\u043b\u0430 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80\" title=\"\u041c\u0435\u0442\u0440\">\u043c\u0435\u0442\u0440\u0430<\/a>: \u043e\u0434\u043d\u0430 \u0441\u043e\u0440\u043e\u043a\u0430\u043c\u0438\u043b\u043b\u0438\u043e\u043d\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c \u0434\u043b\u0438\u043d\u044b \u043f\u0430\u0440\u0438\u0436\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0440\u0438\u0434\u0438\u0430\u043d\u0430.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1814\" class=\"mw-redirect\" title=\"1814\">1814<\/a>&#160;\u2014 \u0421\u043e\u044e\u0437\u043d\u044b\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 (\u0433\u043b\u0430\u0432\u043d\u044b\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0440\u0443\u0441\u0441\u043a\u0438\u0435 \u043a\u043e\u0440\u043f\u0443\u0441\u0430) \u0430\u043d\u0442\u0438\u043d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u043e\u0439 \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u0438 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0438<\/a> \u0438 \u0434\u0440.) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B7%D1%8F%D1%82%D0%B8%D0%B5_%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D0%B0_(1814)\" title=\"\u0412\u0437\u044f\u0442\u0438\u0435 \u041f\u0430\u0440\u0438\u0436\u0430 (1814)\">\u0432\u0437\u044f\u043b\u0438 \u0448\u0442\u0443\u0440\u043c\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436<\/a>, \u0442\u0435\u043c \u0441\u0430\u043c\u044b\u043c \u043f\u043e\u043b\u043e\u0436\u0438\u0432 \u043a\u043e\u043d\u0435\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u043d\u044b\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u043c \u0432\u043e\u0439\u043d\u0430\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1820\" class=\"mw-redirect\" title=\"1820\">1820<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u043c\u0438\u0441\u0441\u0438\u043e\u043d\u0435\u0440\u044b \u043f\u0440\u0438\u0431\u044b\u043b\u0438 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842\" class=\"mw-redirect\" title=\"1842\">1842<\/a>&#160;\u2014 \u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u043a\u0442\u043e\u0440 \u041a\u0440\u043e\u0443\u0444\u043e\u0440\u0434 \u0423\u0438\u043b\u044c\u044f\u043c\u0441\u043e\u043d \u041b\u043e\u043d\u0433 \u0438\u0437 \u0433\u043e\u0440\u043e\u0434\u043a\u0430 \u0414\u0436\u0435\u0444\u0444\u0435\u0440\u0441\u043e\u043d (\u0448\u0442\u0430\u0442 \u0414\u0436\u043e\u0440\u0434\u0436\u0438\u044f), \u0443\u0434\u0430\u043b\u044f\u044f \u043e\u043f\u0443\u0445\u043e\u043b\u044c \u043d\u0430 \u0448\u0435\u0435 \u043f\u0430\u0446\u0438\u0435\u043d\u0442\u0430, \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0438\u043c\u0435\u043d\u0438\u043b \u0432\u043e \u0432\u0440\u0430\u0447\u0435\u0431\u043d\u043e\u0439 \u043f\u0440\u0430\u043a\u0442\u0438\u043a\u0435 \u044d\u0444\u0438\u0440 \u043a\u0430\u043a \u0430\u043d\u0435\u0441\u0442\u0435\u0437\u0438\u0440\u0443\u044e\u0449\u0435\u0435 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u043e \u043f\u0440\u0438 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438. \u041e\u043d \u0438 \u043f\u043e\u0437\u0436\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b \u044d\u0444\u0438\u0440 \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0439, \u043d\u043e \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b \u043e\u0442\u0447\u0451\u0442 \u043e \u0441\u0432\u043e\u0438\u0445 \u043e\u043f\u044b\u0442\u0430\u0445 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 1849 \u0433\u043e\u0434\u0443, \u0447\u0442\u043e \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u043b\u043e \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u0434\u043b\u044f \u043e\u0441\u043f\u0430\u0440\u0438\u0432\u0430\u043d\u0438\u044f \u0435\u0433\u043e \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u044f \u0441\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0434\u0440\u0443\u0433\u0438\u0445 \u043c\u0435\u0434\u0438\u043a\u043e\u0432, \u043f\u0440\u0438\u0448\u0435\u0434\u0448\u0438\u0445 \u043a \u0442\u043e\u0439 \u0436\u0435 \u0438\u0434\u0435\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u043c\u0438 \u0433\u043e\u0434\u0430\u043c\u0438 \u043f\u043e\u0437\u0436\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1847\" class=\"mw-redirect\" title=\"1847\">1847<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%BE%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0422\u043e\u043b\u0441\u0442\u043e\u0439, \u041b\u0435\u0432 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u041b\u0435\u0432 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447 \u0422\u043e\u043b\u0441\u0442\u043e\u0439<\/a> \u043d\u0430\u0447\u0430\u043b \u0432\u0435\u0441\u0442\u0438 \u0434\u043d\u0435\u0432\u043d\u0438\u043a \u0438 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b \u044d\u0442\u043e \u0437\u0430\u043d\u044f\u0442\u0438\u0435 \u0432\u0441\u044e \u0436\u0438\u0437\u043d\u044c. \u0412 \u043f\u043e\u043b\u043d\u043e\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0438 \u0441\u043e\u0447\u0438\u043d\u0435\u043d\u0438\u0439 \u0434\u043d\u0435\u0432\u043d\u0438\u043a\u0438 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044f \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0442 13 \u0442\u043e\u043c\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850\" class=\"mw-redirect\" title=\"1850\">1850<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4\" title=\"\u041f\u0430\u0440\u043e\u0445\u043e\u0434\">\u043f\u0430\u0440\u043e\u0445\u043e\u0434<\/a> \u00ab<a href=\"https:\/\/en.wikipedia.org\/wiki\/RMS_Royal_Adelaide_(1838)\" class=\"extiw\" title=\"en:RMS Royal Adelaide (1838)\">Royal Adelaide<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>) \u043d\u0430\u0441\u043a\u043e\u0447\u0438\u043b \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BB%D1%8C\" title=\"\u041c\u0435\u043b\u044c\">\u043c\u0435\u043b\u044c<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\" title=\"\u0413\u043e\u0440\u043e\u0434\">\u0433\u043e\u0440\u043e\u0434\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B3%D0%B8%D1%82_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u041c\u0430\u0440\u0433\u0438\u0442 (\u0433\u043e\u0440\u043e\u0434)\">\u041c\u0430\u0440\u0433\u0438\u0442<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 \u043e\u043a\u043e\u043b\u043e 300 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856\" class=\"mw-redirect\" title=\"1856\">1856<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%8B%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041a\u0440\u044b\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a> 1853\u20141856&#160;\u0433\u0433. \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B4%D0%B8%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u0430\u0440\u0434\u0438\u043d\u0438\u044f\">\u0421\u0430\u0440\u0434\u0438\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u041f\u0440\u0443\u0441\u0441\u0438\u044f\">\u041f\u0440\u0443\u0441\u0441\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1856)\" title=\"\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1856)\">\u043c\u0438\u0440\u043d\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430<\/a>. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u044f<\/a> \u0432 \u043e\u0431\u043c\u0435\u043d \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\">\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c<\/a> \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u043a\u0440\u044b\u043c\u0441\u043a\u0438\u0435 \u0433\u043e\u0440\u043e\u0434\u0430, \u0432\u0437\u044f\u0442\u044b\u0435 \u0441\u043e\u044e\u0437\u043d\u044b\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438, \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%81\" title=\"\u041a\u0430\u0440\u0441\">\u041a\u0430\u0440\u0441<\/a>, \u041c\u043e\u043b\u0434\u0430\u0432\u0441\u043a\u043e\u0435 \u043a\u043d\u044f\u0436\u0435\u0441\u0442\u0432\u043e&#160;\u2014 \u0447\u0430\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%91%D0%B5%D1%81%D1%81%D0%B0%D1%80%D0%B0%D0%B1%D0%B8%D1%8F\" title=\"\u042e\u0436\u043d\u0430\u044f \u0411\u0435\u0441\u0441\u0430\u0440\u0430\u0431\u0438\u044f\">\u042e\u0436\u043d\u043e\u0439 \u0411\u0435\u0441\u0441\u0430\u0440\u0430\u0431\u0438\u0438<\/a> \u0438 \u0443\u0441\u0442\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D0%BD%D0%B0%D0%B9\" title=\"\u0414\u0443\u043d\u0430\u0439\">\u0414\u0443\u043d\u0430\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856_%D0%B3%D0%BE%D0%B4\" title=\"1856 \u0433\u043e\u0434\">1856<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II<\/a> \u0432 \u0440\u0435\u0447\u0438 \u043f\u0435\u0440\u0435\u0434 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u043c \u0434\u0432\u043e\u0440\u044f\u043d\u0441\u0442\u0432\u043e\u043c \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043e\u0431 \u043e\u0442\u043c\u0435\u043d\u0435 \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0430 \u0441\u0432\u0435\u0440\u0445\u0443: \u00ab\u2026 \u0438 \u0441\u0430\u043c\u0438 \u0432\u044b \u0437\u043d\u0430\u0435\u0442\u0435, \u0447\u0442\u043e \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044e\u0449\u0438\u0439 \u043f\u043e\u0440\u044f\u0434\u043e\u043a \u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f \u0434\u0443\u0448\u0430\u043c\u0438 \u043d\u0435 \u043c\u043e\u0436\u0435\u0442 \u043e\u0441\u0442\u0430\u0432\u0430\u0442\u044c\u0441\u044f \u043d\u0435\u0438\u0437\u043c\u0435\u043d\u043d\u044b\u043c. \u041b\u0443\u0447\u0448\u0435 \u043e\u0442\u043c\u0435\u043d\u0438\u0442\u044c \u043a\u0440\u0435\u043f\u043e\u0441\u0442\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u043e \u0441\u0432\u044b\u0448\u0435, \u043d\u0435\u0436\u0435\u043b\u0438 \u0434\u043e\u0436\u0438\u0434\u0430\u0442\u044c\u0441\u044f, \u043a\u0430\u043a \u043e\u043d\u043e \u0441\u0430\u043c\u043e \u0441\u043e\u0431\u043e\u044e \u0441\u0442\u0430\u043d\u0435\u0442 \u043e\u0442\u043c\u0435\u043d\u044f\u0442\u044c\u0441\u044f \u0441\u043d\u0438\u0437\u0443.\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1858\" class=\"mw-redirect\" title=\"1858\">1858<\/a>&#160;\u2014 \u0425\u0430\u0439\u043c\u0435\u043d \u041b\u0438\u043f\u043c\u0435\u043d \u0438\u0437 \u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u0438 \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043a\u0430\u0440\u0430\u043d\u0434\u0430\u0448 \u0441\u043e \u0441\u0442\u0438\u0440\u0430\u044e\u0449\u0435\u0439 \u0440\u0435\u0437\u0438\u043d\u043a\u043e\u0439 \u043d\u0430 \u0434\u0440\u0443\u0433\u043e\u043c \u043a\u043e\u043d\u0446\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1860\" class=\"mw-redirect\" title=\"1860\">1860<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_II\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 II<\/a> \u041e\u0441\u0432\u043e\u0431\u043e\u0434\u0438\u0442\u0435\u043b\u044c \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043d\u0430\u0447\u0430\u043b\u0435 \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B5%D1%81%D1%82%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0444\u043e\u0440\u043c\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u041a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u043e\u0439 \u0440\u0435\u0444\u043e\u0440\u043c\u044b \u0432 \u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863\" class=\"mw-redirect\" title=\"1863\">1863<\/a>&#160;\u2014 \u0414\u0430\u0442\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D0%B8%D0%BA_VII\" title=\"\u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a VII\">\u0424\u0440\u0435\u0434\u0435\u0440\u0438\u043a VII<\/a> \u043e\u0442\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b \u0428\u043b\u0435\u0437\u0432\u0438\u0433 \u043e\u0442 \u0413\u043e\u043b\u044c\u0448\u0442\u0435\u0439\u043d\u0430 \u0438 \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0438\u043b \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867\" class=\"mw-redirect\" title=\"1867\">1867<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u043e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d\u0435<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u0440\u0443\u0441\u0441\u043a\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0414\u043e\u0433\u043e\u0432\u043e\u0440. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D0%B4%D0%B0%D0%B6%D0%B0_%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B8\" title=\"\u041f\u0440\u043e\u0434\u0430\u0436\u0430 \u0410\u043b\u044f\u0441\u043a\u0438\">\u043f\u0440\u0438\u043e\u0431\u0440\u0435\u043b\u0438<\/a> \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441